@WallStPlayboys mentioned looking at the 10 YR CAGR total return % of S&P500 to determine when overbought, fair value (~7%), oversold. 

Easy way to track it, just put $SPY into Koyfin. 

Provides perspective. While people losing their mind, 10Y annual total return still 9.4%.pic.twitter.com/g7qZV9uJb5
